import React from 'react';
import Logo from '../images/logo.png'
import Celular from '../images/celular.png'
import './Header.css'

const Header = () => {
    return (
        <header className="LandingPageWrapper">
            <img src={Logo} className="Logo" alt="Logo" />
            <h1 className="Titulo">CRIE SEU E-COMMERCE</h1>
            <p className="SubTitulo1">Chegou a hora de criar seu e-commerce com os especialistas da SmileShop.</p>
            <p className="SubTitulo2">Preencha o formulário abaixo que um consultor entrará em contato!</p>

        </header>
    )
}

export default Header;
